import React from 'react';
// import BackgroundImage from '../img/test.png';

/** 
 * TODO replace with api data
*/

export const projectList = [
    {
        icon: 'widgets',
        title: 'Valorant Go! Knife',
        subject: '3D Modelling',
        lastOpened: '20/07/2021',
        components:
            [
                {
                    type: 'largeTile',
                    content: 'In this project my aim was to use SolidWorks to create a replica of an item out of a game. In this case, I wanted to createa a model of the Valorant Go! Knife knife out of the FPS Valorant. Recently (11/09/2021) I bought a 3D printer with the intention of using the printer to not only practice my 3D modelling skills through projects like this but also to create unique prints for family and friends when needed',
                },
                {
                    type: 'mediumImg',
                    path: '/images/val_knife.png',
                    content: 'test',
                },
                {
                    type: 'mediumTile',
                    content: 'Some text about the thing [Duck Duck Go](https://duckduckgo.com)',
                },
                {
                    type: 'normal',
                    "content": "<h2 id=\"foo\"> Header with ID property</h2>",
                },
                {
                    type: 'smallTile',
                    content: 'SMALL TILE',
                },
                {
                    type: 'smallTile',
                    content: 'SMALL TILE',
                },
                {
                    type: 'smallTile',
                    content: 'SMALL TILE',
                },
                {
                    type: 'smallTile',
                    content: 'SMALL TILE',
                },
            ],
    },
    {
        icon: 'mic',
        title: 'Starting with Speechy',
        subject: 'Speechy',
        lastOpened: '15/07/2021',
        components: 
                [
                    {
                        type: 'largeTile',
                        content: 'In this project my aim was to create a python program wherein I could control simple processes on my computer using my voice. When creating the project, my intention was for to have different funcitons located in discrete files so that I could easily implement new features'
                    },
                ],

    },
    {
        icon: 'computer',
        title: 'This Website',
        subject: 'Web Development',
        lastOpened: '12/07/2021',
        components: 
                [
                    {
                        type: 'largeTile',
                        content: "This page is showing you how I made the website that you're looking at right now!"
                    },
                ],
    },
    
];
